import './App.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Index from './components/index'
import Registros from './components/Registros'

function App() {
  return (
  <div>
      <Router>
        <Switch>
          <Route path="/">
            <Index />
          </Route>
          <Route path="/">
            <Registros />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
